\\n    \\r\\n","female"],["\\r\\n\\r\\n\\t \\r\\n       urlLink Apocalyptic Representations of Late Capitalism  Rollerball (1975) speculates upon what mode of capitalism would replace the ailing Fordist mantra. Picking up on a growing unease the public felt with multi-national companies during the mid 70s, it predicts a world run purely by corporations, and explores the means by which this Corporate Society contains the social, and psychological side effects of capitalism that ultimately threaten to undermine it.\\r\\n     \\r\\n    \\r\\n","male"],["\\r\\n\\r\\n\\t \\r\\n      ok, so i have located my novel notes,......and have spent the last little bit with them........organizing them into the following categories.....strictly personal, whooooworthy......parenting/familial issues.....catering/food service.......employee issues....blogging particulars....saving the world......seeing the world......race issues.....religion issues.....i have already taped these cut-up portions of blogs onto the map of the princeton art museum......i have no idea why i have done this.....maybe the bottle of wine i brought with me for such a purpose.........the blogs so chosen are genuinely whoooworthy........that part is good...at least when i am least in focus i have some sense.....\\r\\n     \\r\\n\\r\\n    \\r\\n","female"],["\\r\\n\\r\\n     \\r\\n           Who will you be stuck with at end of time? by  urlLink  chi_a_baidh        Your name is           Your sex is      Male Female Undecided       Your favorite color is      Red Orange Yellow Green Blue Purple Black White Other       You are stuck there because    you murdered everyone else      For _____&nbsp; years    7      With     urlLink  Johnny Depp. Click for pic.       He/She will think you are    sexy      You will    make a coconut radio             Created with the ORIGINAL  urlLink  MemeGen  !      \\r\\n     \\r\\n    \\r\\n","male"],["\\r\\n\\r\\n\\r\\n       \\r\\n      I don\\'t want to talk to anyone - and I want everyone to come over.  Life can be a self-contradicting bastard like that.  I feel like shutting out the world and not coming out until June.  If you see me in the next few days and I seem listless or depressed, at least you\\'ll be expecting it.  I\\'ll find my way out eventually.  And I\\'m pretty much convinced that the events of the past 24 hours occurred as they had to occur.  But damn.  Sometimes everything is perfect and you still lose.  I\\'ll never figure that out.  I think it fits into the cosmic scheme somewhere with all those people in third world countries working in sweatshops for pennies a day being exploited by Western business.  I don\\'t understand why that is allowed to happen, either.  And nobody ever will.  If anyone wants me, I\\'ll be searching desperately for my mind.  \\r\\n     \\r\\n\\r\\n    \\r\\n","male"],["\\r\\n\\r\\n\\t\\t\\t\\t\\t\\t\\r\\n\\t\\t\\t\\t\\t\\t    Meter Maid  I wish everyone let their site meters be public.  I understand why people make them private.  Still, I like to gaze over other\\'s site meters on occassion.  This way I can see if they get any hits from me, and if my readers ever use my links.  Maybe you could email me a copy of your reports, or something.  Come on work with me here.   \\r\\n\\r\\n\\t\\t\\t\\t\\t\\t\\r\\n","male"],["\\r\\n\\r\\n     \\r\\n      How did they not notice before then?  You\\'d think you\\'d feel something like that...like when people get tumors that are the size of grapefruits...did they get that big overnight,  or are people just too stupid to notice a freakin\\' mass growing on their bodies???\\r\\n     \\r\\n    \\r\\n","male"],["\\r\\n\\r\\n\\t \\r\\n      Ok, I thought maybe you and Matt would have gotten my email, went to my own blog and then responded about going to the 3rd Annual Lebowski Fest. But I obviously assumed wrong. So maybe you\\'ll answer me here...want to meet me at  urlLink Lebowski Fest ? Let me know your thoughts. I think it\\'d be friggin\\' awesome!!!\\r\\n
